  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Back Bay Migratory
  Waterfowl Refuge outlines Refuge accomplishments from February through April of
  1941. The report begins by summarizing the weather conditions, water conditions,
  and prescribed burns during this period. Wildlife- including waterbirds, upland
  game birds, and furbearers- is also covered. The Refuge development and maintenance
  section discusses physical developments and plantings. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
